import './App.css';
import Navbars from './components/Navbar'
import Forms from './components/Forms';
import Blog from './components/Blog'
import {Router,Route } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Navbars/>
      <Router>
          <Switch>
            <Route path="/Blog" exact>
              <Blog/>
              <Forms/>
            </Route>
          </Switch>
      </Router>
    </div>
  );
}

export default App;
